import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

// Mock service data (For illustration purposes)
const mockServices = [
    {
        id: 1,
        name: "Pension Form",
        description: "Help with pension form submissions",
        document1: "Pension ID",
        document2: "Bank Passbook",
        document3: "Aadhar Card",
    },
    {
        id: 2,
        name: "Insurance Form",
        description: "Fill out your insurance claim",
        document1: "Insurance Policy",
        document2: "Claim Form",
        document3: "Aadhar Card",
    },
];

function Services() {
    const [services, setServices] = useState([]);
    const [isAdmin, setIsAdmin] = useState(false); // Check if admin is logged in
    const [showServiceForm, setShowServiceForm] = useState(false); // To toggle service form
    const [serviceFormData, setServiceFormData] = useState({
        banner: "",
        name: "",
        description: "",
        document1: "",
        document2: "",
        document3: "",
    });
    const [userFormData, setUserFormData] = useState({
        fullName: "",
        mobile: "",
        email: "",
        documents: [],
    });

    const navigate = useNavigate();

    // Check if the admin is logged in
    useEffect(() => {
        const isLoggedIn = localStorage.getItem("isAdminLoggedIn");
        if (isLoggedIn) {
            setIsAdmin(true);
        }
        setServices(mockServices);
    }, []);

    const handleServiceFormChange = (e) => {
        const { name, value } = e.target;
        setServiceFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleUserFormChange = (e) => {
        const { name, value } = e.target;
        setUserFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleAddService = () => {
        // Submit new service data to the backend or store it locally
        setServices((prevServices) => [...prevServices, serviceFormData]);
        setShowServiceForm(false); // Hide the form
    };

    const handleSubmitUserForm = (e) => {
        e.preventDefault();
        // Handle form submission for the user (for example, sending to API)
        console.log("User form submitted with data:", userFormData);
    };

    return (
        <div className="p-8">
            {/* Admin Adding Service Form */}
            {isAdmin && (
                <div className="flex justify-between items-center">
                    <h1 className="text-3xl font-semibold">Services</h1>
                    <button
                        onClick={() => setShowServiceForm(true)}
                        className="bg-blue-500 text-white px-4 py-2 rounded-full hover:bg-blue-600 transition"
                    >
                        + Add Service
                    </button>
                </div>
            )}

            {/* Display Services */}
            <div className="mt-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
                {services.map((service) => (
                    <div
                        key={service.id}
                        className="border p-4 rounded-lg shadow-md hover:shadow-lg transition cursor-pointer"
                        onClick={() =>
                            !isAdmin && navigate(`/service/${service.id}`)
                        }
                    >
                        <h2 className="text-xl font-bold">{service.name}</h2>
                        <p className="text-gray-700">{service.description}</p>
                    </div>
                ))}
            </div>

            {/* Admin Add Service Form Popup */}
            {showServiceForm && isAdmin && (
                <div className="fixed inset-0 bg-gray-800 bg-opacity-50 flex justify-center items-center">
                    <div className="bg-white p-8 rounded-lg w-96">
                        <h2 className="text-2xl font-semibold mb-4">Add Service</h2>
                        <form onSubmit={handleAddService}>
                            <div className="mb-4">
                                <label htmlFor="banner" className="block">
                                    Service Banner URL
                                </label>
                                <input
                                    type="text"
                                    name="banner"
                                    value={serviceFormData.banner}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="name" className="block">
                                    Service Name
                                </label>
                                <input
                                    type="text"
                                    name="name"
                                    value={serviceFormData.name}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="description" className="block">
                                    Service Description
                                </label>
                                <textarea
                                    name="description"
                                    value={serviceFormData.description}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="document1" className="block">
                                    Document Required 1
                                </label>
                                <input
                                    type="text"
                                    name="document1"
                                    value={serviceFormData.document1}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="document2" className="block">
                                    Document Required 2
                                </label>
                                <input
                                    type="text"
                                    name="document2"
                                    value={serviceFormData.document2}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="document3" className="block">
                                    Document Required 3
                                </label>
                                <input
                                    type="text"
                                    name="document3"
                                    value={serviceFormData.document3}
                                    onChange={handleServiceFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <button
                                type="submit"
                                className="bg-blue-500 text-white px-6 py-2 rounded-full"
                            >
                                Add Service
                            </button>
                            <button
                                type="button"
                                onClick={() => setShowServiceForm(false)}
                                className="ml-4 bg-red-500 text-white px-6 py-2 rounded-full"
                            >
                                Close
                            </button>
                        </form>
                    </div>
                </div>
            )}

            {/* Non-Admin Service Details Form */}
            {!isAdmin && (
                <div>
                    <h2 className="text-2xl font-semibold mt-8">Service Details</h2>
                    <div className="mt-4 p-4 border shadow-md rounded-md">
                        <h3 className="text-xl font-bold">Service Name</h3>
                        <form onSubmit={handleSubmitUserForm}>
                            <div className="mb-4">
                                <label htmlFor="fullName" className="block">
                                    Full Name
                                </label>
                                <input
                                    type="text"
                                    name="fullName"
                                    value={userFormData.fullName}
                                    onChange={handleUserFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="mobile" className="block">
                                    Mobile Number
                                </label>
                                <input
                                    type="text"
                                    name="mobile"
                                    value={userFormData.mobile}
                                    onChange={handleUserFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="email" className="block">
                                    Email Address
                                </label>
                                <input
                                    type="email"
                                    name="email"
                                    value={userFormData.email}
                                    onChange={handleUserFormChange}
                                    className="border p-2 w-full rounded-md"
                                />
                            </div>
                            <div className="mb-4">
                                <label htmlFor="documents" className="block">
                                    Attach Documents
                                </label>
                                <input
                                    type="file"
                                    name="documents"
                                    onChange={handleUserFormChange}
                                    className="border p-2 w-full rounded-md"
                                    multiple
                                />
                            </div>
                            <button
                                type="submit"
                                className="bg-green-500 text-white px-6 py-2 rounded-full"
                            >
                                Submit
                            </button>
                        </form>
                    </div>
                </div>
            )}
        </div>
    );
}

export default Services;
